import React from 'react';
import './Footer.css';

function Footer() {
    return (
      <div className="Footer">
        <ul>Sam's Links
          <li>Instagram</li>
          <li>Twitter</li>
          <li>Facebook</li>
          <li>GitHub</li>
        </ul>
      </div>
    );
}

export default Footer;
